import { useEffect, useState } from "react";
import OpenAI from "openai";

const DALLE_MODEL = "dall-e-2"; // dall-e-3 or dall-e-2

const openai = new OpenAI({
  project: import.meta.env.VITE_OPENAI_PROJ_ID,
  apiKey: import.meta.env.VITE_OPENAI_API_KEY,
  dangerouslyAllowBrowser: true,
});

const createImage = async (prompt: string) =>
  openai.images.generate({
    model: DALLE_MODEL, //dall-e-3 has revised_prompt in response
    // prompt: `Generate an image that looks as close as possible to the famous painting using the description: ${prompt}`, // The maximum length is 1000 characters for dall-e-2 and 4000 characters for dall-e-3.
    prompt,
    n: 1, // Must be between 1 and 10. For dall-e-3, only n=1 is supported.
    size: "256x256", //Defaults to 1024x1024
    style: "vivid", // natural = photo-realistic, vivid = hyper-real and dramatic. Defaults to 'vivid' for dall-e-2 and 'natural' for dall-e-3.
    response_format: "b64_json", // 'url' or 'b64_json'. URLs are only valid for 60 minutes
  });

export default function Image() {
  const [prompt, setPrompt] = useState("");
  const [imgSrc, setImgSrc] = useState("");
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    const getImg = async () => {
      createImage(prompt).then((response) => {
        console.log("Response from OpenAI:", response);
        setImgSrc(response.data[0].url!);
        setLoading(false);
      });
    };
    if (prompt.trim()) {
      setLoading(true);
      console.log("Image description prompt requested!");
      getImg();
    }
  }, [prompt]);

  return (
    <div>
      <h2>
        Image gen <code>{DALLE_MODEL}</code>
      </h2>
      <img
        src="data:image/png;base64,"
        alt="My Image"
      />
      <form
        onSubmit={(e) => {
          e.preventDefault();
          const input = (e.target as HTMLFormElement)
            .elements[0] as HTMLInputElement;
          setPrompt(input.value);
        }}
      >
        <input type="text" placeholder="Describe the image" />
      </form>
      {loading ? (
        "Loading..."
      ) : imgSrc ? (
        <img src={imgSrc} alt="My Image" />
      ) : (
        "No image requested yet."
      )}
    </div>
  );
}
